import styled from "styled-components";

const AddAnime = () => {
  return (
    <>
      <div>視聴アニメの追加ページ</div>
      <TitleArea>
        <p>タイトル</p>
      </TitleArea>
    </>
  );
};
const TitleArea = styled.div``;

export default AddAnime;
